ALTER ROLE postgres WITH PASSWORD 'postgres';

DROP TABLE IF EXISTS dogs;

CREATE TABLE dogs (
	id serial PRIMARY KEY,
	breed VARCHAR(50) UNIQUE,
	description TEXT,
	image BYTEA,
	created_on TIMESTAMP
);

